import React from "react";
import "../../../Styles/Pages/ToSell/ToSellSixth.scss";

function ToSellSixth() {
  return (
    <div className='toSellSixth'>
      <div className='toSellSixth__left'></div>
      <div className='toSellSixth__right'>
        <h1>Sell subscriptions without headaches.</h1>
        <p>
          WithPay2Gate To Sell package, you can also sell subscriptions with no
          worries about recurring billing. Our Account Updater services are on
          stand-by to recover potentially lost revenue and boost your bottom
          line. For advanced subscriptions capabilities, check out To Subscribe
          and To Monetize.
        </p>
      </div>
    </div>
  );
}

export default ToSellSixth;
